import { Title } from "../../components/Title";
import "./Login.css";

export const Login = () => {
    return (
        <main id="login">
            <Title />
            <section>
                <input type="text" placeholder="Username" />
                <input type="text" placeholder="Password" />
            </section>
        </main>
    )
}
